var isOn = true;
var isOnHardOrEasy = true;
var chosen_letters = [];
var level = 2;
var wordLetter;
var i = 0;
var letterCounter = 0;
var newCounter = 0;
var picCounter = 0;
var insertedLetter;
var onAdd = false;

function exitFromApp(){
    if (navigator.app) {
        navigator.app.exitApp();
            //alert('1');
    }
    else if (navigator.device) {
        navigator.device.exitApp();
            //alert('2');
    }
}

$(function(){
    $.extend($.fn.disableTextSelect = function() {
        return this.each(function(){
            $(this).mousedown(function(){return false;});
        });
    });
    $('body').disableTextSelect();//No text selection on elements with a class of 'noSelect'
});

function addLetter(key) {
    if (isOn) {
        isOn = true;
        insertedLetter = $("input[name=letter]").val().toUpperCase();
        //alert(insertedLetter);
        $('#letter'+insertedLetter).css('color', 'black');
        $('#insert')[0].reset();
    	var letter = document.forms[0].letter;
    	letter.value = letter.value + key;
        chosen_letters.push(key);
        onAdd = true;
    }
}

function submitForm() {
    document.forms[0].submit();
}

function emptyLetter() {
    document.forms[0].letter.value = "";
}
                
function changeColor(divObj){
    if(isOn){
        divObj.style.color="yellow";
    }
    $('#add').css('border','5px solid green');
    //isOn = false;
    //alert(obj);
}


